// Assuming the queries are already running and fetching data
await queries.getBenchmarkResults.run();
await queries.getBenchmarks.run();
await queries.getConfigs.run();

console.log("getBenchmarkResults data:", queries.getBenchmarkResults.data);
console.log("getBenchmarks data:", queries.getBenchmarks.data);
console.log("getConfigs data:", queries.getConfigs.data);

const benchmarkResultData = queries.getBenchmarkResults.data || [];
const benchmarkData = queries.getBenchmarks.data || [];
const configData = queries.getConfigs.data || [];

// Transforming the data into the desired format for the delete dropdown
const dropdownOptions = benchmarkResultData.map(result => {
  const benchmark = benchmarkData.find(benchmark => benchmark.id === result.benchmark_id);
  const benchmarkName = benchmark ? benchmark.name : "Unknown Benchmark";

  const config = configData.find(config => config.id === result.config_id);
  const configName = config ? config.name : "Unknown Config";

  return {
    label: `Benchmark: ${benchmarkName} -- Config: ${configName} -- Result: ${result.result}`,
    value: result.id
  };
});

console.log("Dropdown options for delete:", dropdownOptions);

return dropdownOptions;

const fileObject = components.restoreDBFilePicker.file[0];
if (!fileObject) {
  showAlert('warning', 'Please select a file');
  return;
}

const payload = {
  file_content: fileObject.content,
  filename: fileObject.name
};

console.log('Sending payload:', payload);

fetch("http://benchmarkinator-api:12345/import_sql/", {
  method: "POST",
  headers: {
    "Content-Type": "application/json",
  },
  body: JSON.stringify(payload)
})
.then(response => {
  if (!response.ok) {
    return response.text().then(text => {
      console.log('Error response:', text);
      throw new Error(text);
    });
  }
  return response.json();
})
.then(data => {
  console.log('Success response:', data);
  showAlert('success', 'File imported successfully!');
})
.catch(error => {
  console.error('Error:', error);
  showAlert('error', 'Error importing file: ' + error.message);
});

const selectedCpuId = components.viewBenchmarkByCPUDropdown.value;
const selectedGpuId = components.viewBenchmarkByGPUDropdown.value;

if (selectedCpuId && selectedGpuId) {
  await queries.getBenchmarkResultByCPUIDandGPUID.run();

  console.log(queries.getBenchmarkResultByCPUIDandGPUID.data);

  const benchmarkData = queries.getBenchmarkResultByCPUIDandGPUID.data; 
  const benchmarkNames = queries.getBenchmarks.data; 
  const configNames = queries.getConfigs.data; 

  if (benchmarkData && benchmarkData.length > 0) {
    const transformedData = benchmarkData.map(item => {
      const benchmark = benchmarkNames.find(benchmark => benchmark.id === item.benchmark_id);
      const config = configNames.find(config => config.id === item.config_id);

      return {
        benchmark_name: benchmark ? benchmark.name : "Unknown",
        config_name: config ? config.name : "Unknown",         
        result: item.result, 
        timestamp: item.timestamp || "N/A",                     
        notes: item.notes || "No notes",  
      };
    });

    components.viewBenchmarkTable.data = transformedData;

    console.log("Table data updated:", transformedData); 

    return transformedData; 
